	add("cymoscope", "{\"term\":\"cymoscope\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"First attested as \u0027cymatoscope\u0027 in 1903 and as \u0027\u0027 (cymoscope) in 1905; formed as \u0027\u0027 (cȳm-) (the short stem of the Latin {{m|la|cȳma}}, from the Ancient greek (to 1453) \u0027κῦμα\u0027 \u0027kūma\u0027, “wave”) + \u0027-o-\u0027 {{suffix||scope|lang\u003den}}. \u0027\u0027 (cymatoscope) is philologically prescribed in place of \u0027\u0027 (cymoscope) because it preserves the long stem (\u0027\u0027 (κῡμᾰτ-) \u0027kūmat-\u0027) of its ultimate Ancient greek (to 1453) etymon, which properly does not form compounds on its short stem (\u0027\u0027 (κῡμ-) \u0027kūm-\u0027).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1905\u0027\u0027, \u0027Engineering\u0027 LXXIX, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dWe8wAQAAMAAJ\u0026amp;q\u003d%22cymoscope%22\u0026amp;dq\u003d%22cymoscope%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d8ICdT8XHOtD88QPF0_z8DQ\u0026amp;ved\u003d0CD8Q6AEwAg page 742]\u0026lt;/span\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Apparatus belonging to any of these groups might all be called a \u0027\u0027cymoscope\u0027\u0027, or wave-detector\", \"priority\":2}]}, \"synonyms\":{}}");

